import React, {useState} from 'react'
import '../styles/App.css'

const TableHead = (props) => {
  const [headers] = useState([
    { id: 1, name: "Дата" },
    { id: 2, name: "Название" },
    { id: 3, name: "Количество" },
    { id: 4, name: "Расстояние" },
  ]);
  return (
    <div className="header">
      <div className="cell">
        <strong>
          {headers}
        </strong>
      </div>
    </div>
  );
}

export default TableHead
